<SCRIPT>
function handleError() {return true;}
window.onerror = handleError;

/* Load the banner image if there is one */
/* NOTE: This must be called from the BODY onLoad event */
function LoadBanner() {

	/* get the name of the assigned background image */
	h = 0;
	cssDirPath = "";
	bannerimg = "";

	while (h<document.styleSheets.length) {
		i = 0;
		while (i<document.styleSheets(h).rules.length) {
   			if (document.styleSheets(h).rules(i).selectorText == ".EGBanner") {
				bannerimg = document.styleSheets(h).rules(i).style.backgroundImage;
				cssPath = document.styleSheets(h).href;
				
				if (document.styleSheets(h).rules(i).style.display == "none") {
					bannerimg = "none";
				}
				i = document.styleSheets(h).rules.length;
			}
			else {
				i++;
			}
		}
		h++;
	}

	if ((bannerimg.length > 0) && (bannerimg != "none")) {
		/* Strip the URL() notation from the image name */
		if (bannerimg.substr(0,4) == "url(") {
			newimg = bannerimg.substr(4, bannerimg.length-5);
			bannerimg = newimg;
		}

		/* If there is not a slash or back slash in the image name, use the base path of the css */
		cssDirPath = "";
		if (bannerimg.lastIndexOf("/") == -1 && bannerimg.lastIndexOf("\\") == -1)
		{
			posb = cssPath.lastIndexOf("\\");
			posf = cssPath.lastIndexOf("/");
			if (posb > posf) {
				pos = posb;
			}
			else {
				pos = posf;
			}
			
			if (pos > 0)
			{
				cssDirPath = cssPath.substring(0, pos+1);
			}
			
			bannerimg = cssDirPath + bannerimg;
		}

		/* dynamically insert an image tag */
     	document.body.insertAdjacentHTML('AfterBegin', '<CENTER><IMG CLASS="EnterpriseGuideBanner" SRC="' + bannerimg + '" ></CENTER>');
	}
}
</SCRIPT>
